El poema "Lastico-Sexual" es del poeta uruguayo Julio Herrera y Reissig (1875-1910), un importante representante del modernismo hispanoamericano. Vivió a finales del siglo XIX y principios del XX, aunque su obra más significativa se desarrolló en el siglo XIX.
